import React, { useEffect } from 'react'
import { Row, Col } from 'antd';
import 'antd/dist/antd.css';
import './DetailPokemon.css'
import { callApidata } from '../../api/callAPI';
import { pokemon } from './DPstore';
function Detail(){
    pokemon={}
    useEffect(()=>{
        callApidata('102','pokemon').then(res=>{
            // pokemon=res.data
            // let red=res.data.sprites.versions.red-blue;
            console.log(res.data)
            let ab=res.data.abilities;
            let sp=res.data.sprites
            let id=res.data.id
            console.log(ab)
            console.log(sp)
            console.log(id);
            pokemon={id,ab,sp}
            // let sp=
        })
    },[])
    // console.log(pokemon)
    return(
        <Row gutter={[16, 16]} className="detail">
            <Col span={6} ></Col>
            <Col span={12}>
                <Row>
                    <Col span={12}> 
                        <img src='https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/back/102.png'></img>
                    </Col>
                    <Col span={12}> </Col>
                </Row>
            </Col>
            <Col span={6} ></Col>
        </Row>
    )
}
export default Detail
